import * as React from 'react';
import { Dayjs } from 'dayjs';
import { Card, Typography,Button ,TextField, Box} from "@mui/material";
import { LocalizationProvider } from '@mui/x-date-pickers-pro';
import { AdapterDayjs } from '@mui/x-date-pickers-pro/AdapterDayjs';
import { StaticDateRangePicker } from '@mui/x-date-pickers-pro/StaticDateRangePicker';
import { DateRange } from '@mui/x-date-pickers-pro/DateRangePicker';

function StaticDateRangePickerDemo() {
  const [value, setValue] = React.useState<DateRange<Dayjs>>([null, null]);

  return (
    <LocalizationProvider dateAdapter={AdapterDayjs}>
      <StaticDateRangePicker
        displayStaticWrapperAs="desktop"
        value={value}
        onChange={(newValue) => {
          setValue(newValue);
        }}
        renderInput={(startProps, endProps) => (
          <React.Fragment>
            <TextField {...startProps} />
            <Box sx={{ mx: 2 }}> to </Box>
            <TextField {...endProps} />
          </React.Fragment>
        )}
      />
    </LocalizationProvider>
  );
}

function TimeSelection() {
  const [IsButtonClick, setIsButtonClick] = useState(false);
  function ButtonClick(){
    setIsButtonClick(!IsButtonClick);
  }
  return (
    <Card style={{height:"100%"}}>
      <Typography>{IsButtonClick===false?<Button onClick={ButtonClick}>Time Selection</Button>:"timeselect"}</Typography>
      <StaticDateRangePickerDemo/>
    </Card>
  );
}
export default TimeSelection;
